import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
import ListaExpositores from "./components/ListaExpositores";
import CrearExpositor from "./components/CrearExpositor";
import EditarExpositor from "./components/EditarExpositor";
import SubirContenido from "./components/SubirContenido";
import ListaGaleria from "./components/ListaGaleria";


function App() {
    return (
        <Router>
            <Navbar />
            <div style={{ padding: "20px" }}>
                <Routes>
                    <Route path="/" element={<h2>Bienvenido a la Galería de Proyectos</h2>} />
                    <Route path="/crear" element={<CrearExpositor />} />
                    <Route path="/expositores" element={<ListaExpositores />} />
                    <Route path="/editar/:id" element={<EditarExpositor />} />

                    {/* Ruta para subir contenido */}
                    <Route path="/expositor/:id/subir" element={<SubirContenido />} />

                    {/* Ruta para mostrar la galería de contenidos */}
                    <Route path="/expositor/:id/galeria" element={<ListaGaleria />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
